import Form from "./Form";
import Main from "./Main";
import Theme from "./Theme";
import DarkModeProvider from "../context/DarkModeContext";
import Icon from "../Icon";
import "./todo.css";

export default function ToDo() {
  return (
    <DarkModeProvider>
      <Icon />
      <Theme />
      <Main />
    </DarkModeProvider>
  );
}
